`,readingTime:{minutes:.2,words:61},title:"奇怪世界",type:"article"}}],["/guide/my_project/",{loader:()=>g(()=>import("./index.html-Dryj7Qg1.js"),__vite__mapDeps([32,1])),meta:{date:1726510733e3,readingTime:{minutes:.03,words:10},title:"我的项目",order:1,type:"article"}}],["/guide/my_project/merge.html",{loader:()=>g(()=>import("./merge.html-CCF6XWbO.js"),__vite__mapDeps([33,1])),meta:{date:1726510733e3,excerpt:`<p><em>merge.html</em>是负责合并文件的的html文件,可以将多个分割的文件合并为一个文件.通过使用StreamSaver.js实现文件合并,文件处理合并全在浏览器本地完成的.需要支持流式传输,所以不支持流式传输的无法使用(例如第三方下载器,安卓webview等).</p>
<div class="hint-container warning">
<p class="hint-container-title">注意</p>
<p>merge.html目前存在Cors跨域请求问题,目前没法解决(浏览器安全策略限制)</p>
</div>
